	<body>
		<script> 
			function searchKeyPress(e) {
				e = e || window.event;
				
				if (e.keyCode == 13)
				{
					document.getElementById('submit').click();
					document.getElementById('symbol').value = "";
					return false;
				}
				
				return true;
			}

			function getData() {
			var url = "http://query.yahooapis.com/v1/public/yql";
			var symbol = $("#symbol").val();
			var data = encodeURIComponent("select * from yahoo.finance.quotes where symbol in ('" + symbol + "')");

			$.getJSON(url, 'q=' + data + "&format=json&diagnostics=true&env=http://datatables.org/alltables.env")
				.done(function (data) {
					if (symbol.match(/^([a-zA-Z]|\^)+$/)) {
						if (data.query.results.quote.ChangeinPercent === "+0.00%") {
							document.getElementById("result").innerHTML = document.getElementById("result").innerHTML + symbol + "\xa0" + data.query.results.quote.LastTradePriceOnly + " ";
						} else if (data.query.results.quote.ChangeinPercent.charAt(0) === "+") {
							document.getElementById("result").innerHTML = document.getElementById("result").innerHTML + symbol + "<span style=\x27color: green;\x27>\xa0" + data.query.results.quote.LastTradePriceOnly + "</span> ";
						} else {
							document.getElementById("result").innerHTML = document.getElementById("result").innerHTML + symbol + "<span style=\x27color: red;\x27>\xa0" + data.query.results.quote.LastTradePriceOnly + "</span> ";
						}
					}
				})
				document.getElementById('symbol').value = "";
			}
		</script>
